import React, { useEffect, useState, useRef } from 'react';
import axios from 'axios';
import { Container, Typography, Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Box, Button } from '@mui/material';
import { Print as PrintIcon } from '@mui/icons-material';

function PredictionHistory() {
  const [history, setHistory] = useState([]);
  const printRefs = useRef({});

  useEffect(() => {
    fetchHistory();
  }, []);

  const fetchHistory = () => {
    axios.get('http://localhost:5000/history')
      .then(response => {
        setHistory(response.data);
      })
      .catch(error => {
        console.error('Error fetching history:', error);
      });
  };

  // Define the order of feature names matching the backend data order
  const fieldNames = [
    'Pregnancies',
    'Glucose Level',
    'Blood Pressure',
    'Skin Thickness',
    'Insulin Level',
    'Body Mass Index (BMI)',
    'Diabetes Pedigree Function',
    'Age'
  ];

  // Print function for individual entries
  const handlePrint = (index) => {
    const printContent = printRefs.current[index];
    const printWindow = window.open('', '', 'width=800,height=600');
    printWindow.document.write('<html><head><title>Print</title></head><body>');
    printWindow.document.write(printContent.innerHTML);
    printWindow.document.write('</body></html>');
    printWindow.document.close();
    printWindow.print();
  };

  return (

    <>
      <nav>
        <a href="#">
          <svg 
            id="logo-15" 
            width="49" 
            height="48" 
            viewBox="0 0 49 48" 
            fill="none" 
            xmlns="http://www.w3.org/2000/svg"
          >
            <path 
              d="M24.5 12.75C24.5 18.9632 19.4632 24 13.25 24H2V12.75C2 6.53679 7.03679 1.5 13.25 1.5C19.4632 1.5 24.5 6.53679 24.5 12.75Z" 
              className="ccustom" 
              fill="#17CF97"
            />
            <path 
              d="M24.5 35.25C24.5 29.0368 29.5368 24 35.75 24H47V35.25C47 41.4632 41.9632 46.5 35.75 46.5C29.5368 46.5 24.5 41.4632 24.5 35.25Z" 
              className="ccustom" 
              fill="#17CF97"
            />
            <path 
              d="M2 35.25C2 41.4632 7.03679 46.5 13.25 46.5H24.5V35.25C24.5 29.0368 19.4632 24 13.25 24C7.03679 24 2 29.0368 2 35.25Z" 
              className="ccustom" 
              fill="#17CF97"
            />
            <path 
              d="M47 12.75C47 6.53679 41.9632 1.5 35.75 1.5H24.5V12.75C24.5 18.9632 29.5368 24 35.75 24C41.9632 24 47 18.9632 47 12.75Z" 
              className="ccustom" 
              fill="#17CF97"
            />
          </svg>
        </a>
        <div>
          <ul id="navbar" className={clicked ? "active" : ""}>
            <li><a className="active" href="/userDiabeticHis">History</a></li>
            <li><a className="active" href="/userAcc">Back</a></li>
            <li><a href="/home">Logout</a></li>
          </ul>
        </div>
        <div id="mobile" onClick={handleClick}>
          <i id="bar" className={clicked ? 'fas fa-times' : 'fas fa-bars'}></i>
        </div>
      </nav>

    <Container maxWidth="lg">
      <Paper elevation={3} style={{ padding: '20px', marginTop: '20px' }}>
        <Typography variant="h5" align="center" gutterBottom style={{ fontWeight: 'bold' }}>
          Prediction History
        </Typography>
        <TableContainer component={Paper}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Index</TableCell>
                <TableCell>Features</TableCell>
                <TableCell>Result</TableCell>
                <TableCell>Date</TableCell>
                <TableCell>Print</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {history.map((entry, index) => (
                <TableRow key={index}>
                  <TableCell>{index + 1}</TableCell>
                  <TableCell>
                    <Box ref={(el) => (printRefs.current[index] = el)}>
                      {entry.features.map((value, idx) => (
                        <Typography key={idx} variant="body2">
                          <strong>{fieldNames[idx]}:</strong> {value}
                        </Typography>
                      ))}
                    </Box>
                  </TableCell>
                  <TableCell>{entry.result}</TableCell>
                  <TableCell>{new Date(entry.date).toLocaleString()}</TableCell>
                  <TableCell>
                    <Button 
                      variant="outlined" 
                      color="primary" 
                      startIcon={<PrintIcon />} 
                      onClick={() => handlePrint(index)}
                    >
                      Print
                    </Button>
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      </Paper>
    </Container>
    </>
  );
}

export default PredictionHistory;
